INSERT INTO `beritas` VALUES (22, 'Gandeng Kostrad, Pupuk Kaltim Luncurkan Program Hutan Masyarakat untuk Kurangi Emisi Karbon', 'gandeng-kostrad-pupuk-kaltim-luncurkan-program-hutan-masyarakat-untuk-kurangi-emisi-karbon', '<p>amm,mnmn</p>', '<p><span style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\">Sebagai bentuk nyata penerapan prinsip environment, social, and governance (ESG), PT Pupuk Kalimantan Timur (PKT) atau Pupuk Kaltim meluncurkan program yang bertujuan mengurangi emisi karbon, yakni Community Forest. Lewat program itu, perusahaan pelopor transformasi hijau di industri petrokimia Tanah Air tersebut menggandeng Tentara Nasional Indonesia (TNI) untuk melakukan penanaman 10 juta pohon hingga 2030. Direktur Utama Pupuk Kaltim Rahmad Pribadi mengatakan bahwa pihaknya konsisten melakukan inovasi berkelanjutan untuk mencapai target pengurangan emisi karbon lewat beragam program yang mendukung.</span><br style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\"><br style=\"color: rgb(42, 42, 42); font-family: Roboto, sans-serif; font-size: 14px;\"><br></p>', '<p>,mjkhklhkhkl</p>', '20221017024057.jpg', NULL, 1, NULL, 1, 'active', '2022-10-17 02:40:57', NULL, '2');

