INSERT INTO `pages` VALUES (6, '/pages-sejarah-bkkbn-2012044806-352', 'sejarah-bkkbn-2012044806-352', '2', 'Sejarah BKKBN', '<p>Periode Perintisan (1950-an – 1966)</p><p>Organisasi keluarga berencana dimulai dari pembentukan Perkumpulan Keluarga Berencana pada tanggal 23 Desember 1957 di gedung Ikatan Dokter Indonesia. Nama perkumpulan itu sendiri berkembang menjadi Perkumpulan Keluarga Berencana Indonesia (PKBI) atau Indonesia Planned Parenthood Federation (IPPF). PKBI memperjuangkan terwujudnya keluarga- keluarga yang sejahtera melalui 3 macam usaha pelayanan yaitu mengatur kehamilan atau menjarangkan kehamilan, mengobati kemandulan serta memberi nasihat perkawinan.</p><p>Pada tahun 1967, PKBI diakui sebagai badan hukum oleh Departemen Kehakiman. Kelahiran Orde Baru pada waktu itu menyebabkan perkembangan pesat usaha penerangan dan pelayanan KB di seluruh wilayah tanah air.</p><p>Dengan lahirnya Orde Baru pada bulan maret 1966 masalah kependudukan menjadi fokus perhatian pemerintah yang meninjaunya dari berbagai perspektif. Perubahan politik berupa kelahiran Orde Baru tersebut berpengaruh pada perkembangan keluarga berencana di Indonesia. Setelah simposium Kontrasepsi di Bandung pada bulan Januari 1967 dan Kongres Nasional I PKBI di Jakarta pada tanggal 25 Februari 1967.</p><p><br></p><p>Periode Keterlibatan Pemerintah dalam Program KB Nasional</p><p>Di dalam Kongres Nasional I PKBI di Jakarta dikeluarkan pernyataan sebagai berikut:</p><p>PKBI menyatakan penghargaan yang setinggi-tingginya kepada pemerintah yang telah mengambil kebijaksanaan mengenai keluarga berencana yang akan dijadikan program pemerintah</p><p>PKBI mengharapkan agar Keluarga Berencana sebagai Program Pemerintah segera dilaksanakan.</p><p>PKBI sanggup untuk membantu pemerintah dalam melaksanakan program KB sampai di pelosok-pelosok supaya faedahnya dapat dirasakan seluruh lapisan masyarakat.</p><p>Pada tahun 1967 Presiden Soeharto menandatangani Deklarasi Kependudukan Dunia yang berisikan kesadaran betapa pentingnya menentukan atau merencanakan jumlah anak, dan menjarangkan kelahiran dalam keluarga sebagai hak asasi manusia.</p><p>Pada tanggal 16 Agustus 1967 di depan Sidang DPRGR, Presiden Soeharto pada pidatonya “Oleh karena itu kita harus menaruh perhatian secara serius mengenai usaha-usaha pembatasan kelahiran, dengan konsepsi keluarga berencana yang dapat dibenarkan oleh moral agama dan moral Pancasila”. Sebagai tindak lanjut dari Pidato Presiden tersebut, Menkesra membentuk Panitia Ad Hoc yang bertugas mempelajari kemungkinan program KB dijadikan Program Nasional.</p><p>Selanjutnya pada tanggal 7 September 1968 Presiden mengeluarkan Instruksi Presiden No. 26 tahun 1968 kepada Menteri Kesejahteraan Rakyat, yang isinya antara lain:</p><p>Membimbing, mengkoordinir serta mengawasi segala aspirasi yang ada di dalam masyarakat di bidang Keluarga Berencana.</p><p>Mengusahakan segala terbentuknya suatu Badan atau Lembaga yang dapat menghimpun segala kegiatan di bidang Keluarga Berencana, serta terdiri atas unsur Pemerintah dan masyarakat.</p><p>Berdasarkan Instruksi Presiden tersebut Menkesra pada tanggal 11 Oktober 1968 mengeluarkan Surat Keputusan No. 35/KPTS/Kesra/X/1968 tentang Pembentukan Tim yang akan mengadakan persiapan bagi Pembentukan Lembaga Keluarga Berencana. Setelah melalui pertemuan-pertemuan Menkesra dengan beberapa menteri lainnya serta tokoh-tokoh masyarakat yang terlibat dalam usaha KB, Maka pada tanggal 17 Oktober 1968 dibentuk Lembaga Keluarga Berencana Nasional (LKBN) dengan Surat Keputusan No. 36/KPTS/Kesra/X/1968. Lembanga ini statusnya adalah sebagai Lembaga Semi Pemerintah.</p><p><br></p><p>Periode Pelita I (1969-1974)</p><p>Periode ini mulai dibentuk Badan Koordinasi Keluarga Berencana Nasional (BKKBN) berdasarkan Keppres No. 8 Tahun 1970 dan sebagai Kepala BKKBN adalah dr. Suwardjo Suryaningrat. Dua tahun kemudian, pada tahun 1972 keluar Keppres No. 33 Tahun 1972 sebagai penyempurnaan Organisasi dan tata kerja BKKBN yang ada. Status badan ini berubah menjadi Lembaga Pemerintah Non Departemen yang berkedudukan langsung dibawah Presiden.</p><p>Untuk melaksanakan program keluarga berencana di masyarakat dikembangkan berbagai pendekatan yang disesuaikan dengan kebutuhan program dan situasi serta kondisi masyarakat. Pada Periode Pelita I dikembangkan Periode Klinik (Clinical Approach) karena pada awal program, tantangan terhadap ide keluarga berencana (KB) masih sangat kuat, untuk itu pendekatan melalui kesehatan yang paling tepat.</p><p><br></p><p>Periode Pelita II (1974-1979)</p><p>Kedudukan BKKBN dalam Keppres No. 38 Tahun 1978 adalah sebagai lembaga pemerintah non-departemen yang berada di bawah dan bertanggung jawab kepada Presiden. Tugas pokoknya adalah mempersiapkan kebijaksanaan umum dan mengkoordinasikan pelaksanaan program KB nasional dan kependudukan yang mendukungnya, baik di tingkat pusat maupun di tingkat daerah serta mengkoordinasikan penyelenggaraan pelaksanaan di lapangan.</p><p>Periode ini pembinaan dan pendekatan program yang semula berorientasi pada kesehatan ini mulai dipadukan dengan sector-sektor pembangunan lainnya, yang dikenal dengan Pendekatan Integratif (Beyond Family Planning). Dalam kaitan ini pada tahun 1973-1975 sudah mulai dirintis Pendidikan Kependudukan sebagai pilot project.</p><p><br></p><p>Periode Pelita III (1979-1984)</p><p>Periode ini dilakukan pendekatan Kemasyarakatan (partisipatif) yang didorong peranan dan tanggung jawab masyarakat melalui organisasi/institusi masyarakat dan pemuka masyarakat, yang bertujuan untuk membina dan mempertahankan peserta KB yang sudah ada serta meningkatkan jumlah peserta KB baru. Pada masa periode ini juga dikembangkan strategi operasional yang baru yang disebut Panca Karya dan Catur Bhava Utama yang bertujuan mempertajam segmentasi sehingga diharapkan dapat mempercepat penurunan fertilitas. Pada periode ini muncul juga strategi baru yang memadukan KIE dan pelayanan kontrasepsi yang merupakan bentuk “Mass Campaign” yang dinamakan “Safari KB Senyum Terpadu”.</p><p><br></p><p>Periode Pelita IV (1983-1988)</p><p>Pada masa Kabinet Pembangunan IV ini dilantik Prof. Dr. Haryono Suyono sebagai Kepala BKKBN menggantikan dr. Suwardjono Suryaningrat yang dilantik sebagai Menteri Kesehatan. Pada masa ini juga muncul pendekatan baru antara lain melalui Pendekatan koordinasi aktif, penyelenggaraan KB oleh pemerintah dan masyarakat lebih disinkronkan pelaksanaannya melalui koordinasi aktif tersebut ditingkatkan menjadi koordinasi aktif dengan peran ganda, yaitu selain sebagai dinamisator juga sebagai fasilitator. Disamping itu, dikembangkan pula strategi pembagian wilayah guna mengimbangi laju kecepatan program.</p><p>Pada periode ini juga secara resmi KB Mandiri mulai dicanangkan pada tanggal 28 Januari 1987 oleh Presiden Soeharto dalam acara penerimaan peserta KB Lestari di Taman Mini Indonesia Indah. Program KB Mandiri dipopulerkan dengan kampanye LIngkaran Biru (LIBI) yang bertujuan memperkenalkan tempat-tempat pelayanan dengan logo Lingkaran Biru KB.</p><p><br></p><p>Periode Pelita V (1988-1993)</p><p>Pada masa Pelita V, Kepala BKKBN masih dijabat oleh Prof. Dr. Haryono Suyono. Pada periode ini gerakan KB terus berupaya meningkatkan kualitas petugas dan sumberdaya manusia dan pelayanan KB. Oleh karena itu, kemudian diluncurkan strategi baru yaitu Kampanye Lingkaran Emas (LIMAS). Jenis kontrasepsi yang ditawarkan pada LIBI masih sangat terbatas, maka untuk pelayanan KB LIMAS ini ditawarkan lebih banyak lagi jenis kontrasepsi, yaitu ada 16 jenis kontrepsi.</p><p>Pada periode ini ditetapkan UU No. 10 Tahun 1992 tentang Perkembangan Kependudukan dan Pembangunan Keluarga Sejahtera, dan Garis-Garis Besar Haluan Negara (GBHN) 1993 khususnya sub sector Keluarga Sejahtera dan Kependudukan, maka kebijaksanaan dan strategi gerakan KB nasional diadakan untuk mewujudkan keluarga Kecil yang sejahtera melalui penundaan usia perkawinan, penjarangan kelahiran, pembinaan ketahanan keluarga dan peningkatan kesejahteraan keluarga.</p><p><br></p><p>Periode Pelita VI (1993-1998)</p><p>Pada Pelita VI dikenalkan pendekatan baru yaitu “Pendekatan Keluarga” yang bertujuan untuk menggalakan partisipasi masyarakat dalam gerakan KB nasional. Dalam Kabinet Pembangunan VI sejak tanggal 19 Maret 1993 sampai dengan 19 Maret 1998, Prof. Dr. Haryono Suyono ditetapkan sebagai Menteri Negara Kependudukan/Kepala BKKBN, sebagai awal dibentuknya BKKBN setingkat Kementerian.</p><p>Pada tangal 16 Maret 1998, Prof. Dr. Haryono Suyono diangkat menjadi Menteri Koordinator Bidang Kesejahteraan Rakyat dan Pengentasan Kemiskinan merangkap sebagai Kepala BKKBN. Dua bulan berselang dengan terjadinya gerakan reformasi, maka Kabinet Pembangunan VI mengalami perubahan menjadi Kabinet Reformasi Pembangunan Pada tanggal 21 Mei 1998, Prof. Haryono Suyono menjadi Menteri Koordinator Bidang Kesra dan Pengentasan Kemiskinan, sedangkan Kepala BKKBN dijabat oleh Prof. Dr. Ida Bagus Oka sekaligus menjadi Menteri Kependudukan.</p><p><br></p><p>Periode Pasca Reformasi</p><p>Dari butir-butir arahan GBHN Tahun 1999 dan perundang-undangan yang telah ada, Program Keluarga Berencana Nasional merupakan salah satu program untuk meningkatkan kualitas penduduk, mutu sumber daya manusia, kesehatan dan kesejahteraan sosial yang selama ini dilaksanakan melalui pengaturan kelahiran, pendewasaan usia perkawinan, peningkatan ketahanan keluarga dan kesejahteraan keluarga. Arahan GBHN ini kemudian dijabarkan lebih lanjut dalam Program Pembangunan Nasional (PROPENAS) yang telah ditetapkan sebagai Undang-Undang Nomor 25 Tahun 2000.</p><p>Sejalan dengan era desentralisasi, eksistensi program dan kelembagaan keluarga berencana nasional di daerah mengalami masa-masa kritis. Sesuai dengan Keppres Nomor 103 Tahun 2001, yang kemudian diubah menjadi Keppres Nomor 09 Tahun 2004 tentang Kedudukan, Tugas, Fungsi, Kewenangan, Susunan Organisasi dan Tata Kerja Lembaga Pemerintah Non Departemen menyatakan bahwa sebagian urusan di bidang keluarga berencana diserahkan kepada pemerintah kabupaten dan kota selambat-lambatnya Desember 2003. Hal ini sejalan dengan esensi UU Nomor 22 Tahun 1999 (telah diubah menjadi Undang- Undang Nomor 32 Tahun 2004). Dengan demikian tahun 2004 merupakan tahun pertama Keluarga Berencana Nasional dalam era desentralisasi.</p><p>Undang-Undang Nomor 52 Tahun 2009 tentang Perkembangan Kependudukan dan Pembangunan Keluarga, yang telah disahkan pada tanggal 29 Oktober 2009, berimplikasi terhadap perubahan kelembagaan, visi, dan misi BKKBN. Undang-Undang tersebut mengamanatkan perubahan kelembagaan BKKBN yang semula adalah Badan Koordinasi Keluarga Berencana Nasional menjadi Badan Kependudukan dan Keluarga Berencana Nasional. Visi BKKBN adalah “Penduduk Tumbuh Seimbang 2015” dengan misi “mewujudkan pembangunan yang berwawasan kependudukan dan mewujudkan keluarga kecil bahagia sejahtera”. Untuk mencapai visi dan misi tersebut, BKKBN mempunyai tugas dan fungsi untuk melaksanakan pengendalian penduduk dan penyelenggaraan keluarga berencana sebagaimana diamanatkan dalam Pasal 56 Undang-Undang tersebut di atas. Dalam rangka pengendalian penduduk dan penyelenggaraan keluarga berencana di daerah, pemerintah daerah membentuk Badan Kependudukan dan Keluarga Berencana Daerah yang selanjutnya disingkat BKKBD di tingkat provinsi dan kabupaten dan kota yang dalam melaksanakan tugas dan fungsinya memiliki hubungan fungsional dengan BKKBN (pasal 54 ayat 1 dan 2).</p><p>Peran dan fungsi baru BKKBN diperkuat dengan adanya Peraturan Presiden Nomor 3 Tahun 2013 tentang Perubahan Ketujuh Atas Keputusan Presiden Nomor 103 Tahun 2001 tentang Kedudukan, Tugas, Fungsi, Kewenangan, Susunan Organisasi dan Tata Kerja Lembaga Pemerintah Non Kementerian; Peraturan Kepala BKKBN Nomor 82/PER/B5/2011 tentang Organisasi dan Tata Kerja Perwakilan Badan Kependudukan dan Keluarga Berencana Nasional Provinsi dan Peraturan Kepala BKKBN Nomor 92/PER/B5/2011 tentang Organisasi Tata Kerja Balai Pendidikan dan Pelatihan Kependudukan dan Keluarga Berencana, sehingga perlu dilakukan perubahan/penyesuaian terhadap Renstra BKKBN tentang Pembangunan Kependudukan dan Keluarga Berencana Nasional Tahun 2010-2014 meliputi penyesuaian untuk beberapa kegiatan prioritas dan indikator kinerjanya.</p><p><br></p><p>Pasca Reformasi Kepala BKKBN telah mengalami beberapa pergantian:</p><p>Pada Periode Kabinet Persatuan Indonesia, Kepala BKKBN dirangkap oleh Menteri Negara Pemberdayaan Perempuan yang dijabat oleh Khofifah Indar Parawansa.</p><p>Setelah itu digantikan oleh Prof. Dr. Yaumil C. Agoes Achir pada tahun 2001 dan meninggal dunia pada akhir 2003 akibat penyakit kanker dan yang kemudian terjadi kekosongan.</p><p>Pada tanggal 10 November 2003, Kepala Litbangkes Departemen Kesehatan dr. Sumarjati Arjoso, SKM dilantik menjadi Kepala BKKBN oleh Menteri Kesehatan Ahmad Sujudi sampai beliau memasuki masa pensiun pada tahun 2006.</p><p>Setelah itu digantikan oleh Dr. Sugiri Syarief, MPA yang dilantik sebagai Kepala BKKBN pada tanggal 24 Nopember 2006.</p><p>Sebagai tindak lanjut dari UU 52/2009 tentang Perkembangan Kependudukan dan Pembangunan Keluarha Sejahtera, di mana BKKBN kemudian direstrukturisasi menjadi badan kependudukan, bukan lagi badan koordinasi, maka pada tanggal 27 September 2011 Kepala BKKBN, Dr. dr. Sugiri Syarief, MPA akhirnya dilantik sebagai Kepala Badan Kependudukan dan Keluarga Berencana (BKKBN).</p><p>Pada tanggal 13 Juni 2013 akhirnya Presiden Susilo Bambang Yudhoyono menetapkan mantan Wakil Menteri Pendidikan dan Kebudayaan Prof. Fasli Jalal sebagai Kepala Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN).</p><p><br></p><p>Pada masa kepemimpinan Presiden Joko Widodo, pada tanggal 26 Mei 2015 Presiden melantik dr Surya Chandra Surapaty, MPH., Ph.D sebagai Kepala Badan Kependudukan dan Keluarga Berencana Nasional. Setelah itu untuk mengisi kekosongan, Menteri Kesehatan melantik Deputi Bidang Koordinasi Peningkatan Kesehatan Kemenko PMK sebagai plt. Kepala BKKBN dr. Sigit Priohutomo, MPH hingga memasuki purna tugas pada tanggal 1 Januari 2019.&nbsp;</p><p><br></p><p>Pada tanggal 1 Juli 2019 Presiden Joko Widodo melantik dr Hasto Wardoyo, Sp.OG(K) sebagai Kepala Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN), yang sebelumnya menjabat sebagai Bupati terpilih di Kabupaten Kulon Progo, Provinsi Daerah Istimewa Yogyakarta.</p>', 'active');
INSERT INTO `pages` VALUES (7, '/pages-tugas-pokok-dan-fungsi-2012044810-466', 'tugas-pokok-dan-fungsi-2012044810-466', '2', 'TUGAS POKOK DAN FUNGSI', '<p>BKKBN mempunyai tugas:</p><p><br></p><p>“Melaksanakan tugas pemerintahan di bidang pengendalian penduduk dan penyelenggaraan keluarga berencana”</p><p><br></p><p>Dalam melaksanakan tugas sebagaimana dimaksud, BKKBN menyelenggarakan fungsi:</p><p><br></p><p>Perumusan kebijakan nasional, pemaduan dan sinkronisasi kebijakan di bidang KKB;</p><p>Penetapan norma, standar, prosedur dan kriteria di bidang KKB;</p><p>Pelaksanaan advokasi dan koordinasi di bidang pengendalian penduduk dan KB;</p><p>Penyelenggaraan komunikasi, informasi dan edukasi di bidang KKB;</p><p>Penetapan perkiraaan pengendalian penduduk secara nasional;</p><p>Penyusunan desain Program KKBPK;</p><p>Pengelolaan tenaga penyuluh KB/petugas lapangan KB (PKB/PLKB);</p><p>Pengelolaan dan penyediaan alat dan obat kontrasepsi untuk kebutuhan Pasangan Usia Subur (PUS) nasional;</p><p>Pengelolaan dan pengendalian sistem informasi keluarga</p><p>Pemberdayaan dan peningkatan peran serta organisasi kemasyarakatan tingkatnasional dalam pengendalian pelayanan dan pembinaan kesertaan ber-KB dan Kesehatan Reproduksi (KR);</p><p>Pengembangan desain program pembangunan keluarga melalui pembinaan ketahanan dan kesejahteraan keluarga;</p><p>Pemberdayaan dan peningkatan peran serta organisasi kemasyarakatan tingkat nasional dalam pembangunan keluarga melalui ketahanan dan kesejahteraan keluarga;</p><p>Standardisasi pelayanan KB dan sertifikasi tenaga penyuluh KB/petugas lapangan KB (PKB/PLKB);</p><p>Penyelenggaraan pemantauan dan evaluasi di bidang pengendalian penduduk dankeluarga berencana; dan</p><p>Pembinaan, pembimbingan dan fasilitas di bidang KKB.</p><p>Selain menyelenggarakan fungsi tersebut, BKKBN juga menyelenggarakan fungsi:</p><p><br></p><p>Penyelenggaraan pelatihan, penelitian dan pengembangan di bidang KKB;</p><p>Pembinaan dan koordinasi pelaksanaan tugas administrasi umum di lingkunganBKKBN;</p><p>Pengelolaan barang milik/kekayaan negara yang menjadi tanggung jawab BKKBN;</p><p>Pengawasan atas pelaksanaan tugas di lingkungan BKKBN; dan</p><p>Penyampaian laporan, saran dan pertimbangan di bidang KKB.</p>', 'active');
