INSERT INTO `pages` VALUES (10, '/pages-informasi-yang-wajib-diumumkan-secara-serta-merta', 'informasi-yang-wajib-diumumkan-secara-serta-merta', '2', 'INFORMASI YANG WAJIB DIUMUMKAN SECARA SERTA MERTA', '<p><span style=\"color: rgb(123, 128, 133); font-family: &quot;Open Sans&quot;; font-size: 14px;\">saat ini Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN) tidak mempunyai informasi yang wajib diumumkan secara serta merta</span><br></p>', 'active');
INSERT INTO `pages` VALUES (11, '/pages-profil-ppid', 'profil-ppid', '2', 'PROFIL PPID', '<p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Sesuai implementasi dari UU No.14 Tahun 2008, Badan Kependudukan dan Keluarga Berencana Nasional (BKKBN) sebagai salah satu Badan Publik telah dibentuk Pejabat Pengelola Informasi dan Dokumentasi (PPID) pada tanggal 11 Juli 2011 melalui Peraturan Kepala (PERKA) BKKBN No. 136/PER/D2/2011 tentang Pengelolaan Informasi Publik di BKKBN ditindak lanjuti dengan Keputusan Kepala (KEPKA) No. 137/KEP/D2/2011 tentang Pejabat Pengelola Informasi Publik di BKKBN.</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Sesuai dengan Keputusan Kepala No. 137/KEP/D2/2011 ditetapkan:</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">1. Atasan PPID dijabat oleh Deputi Bidang Advokasi Penggerakan dan Informasi</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">2. PPID Utama dijabat Direktur Teknologi Informasi dan Dokumentasi</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">3. Wakil Ketua PPID dijabat Kepala Biro Hukum Organisasi dan Humas</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">4. Sekretaris PPID dijabat Kasubdit Dokumentasi dan Penyebarluasan Informasi</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Kepka tersebut terjadi perubahan pada tahun 2018, sesuai dengan Kepka No. 69/KEP/G5/2018 tentang Perubahan Kepka No. 137/KEP/D2/2011 tentang Pejabat PPID BKKBN dimana ditambahkan Petugas Penyedia Informasi di setiap unit kerja pusat.</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Dengan adanya PPID di BKKBN maka publik dapat mengontrol semua informasi program Pembangunan Keluarga, Kependudukan dan Keluarga Berencana (Bangga Kencana) termanfaatkan oleh masyarakat.</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Tugas PPID Utama BKKBN adalah:</p><ol style=\"margin-right: 0px; margin-bottom: 0.273em; margin-left: 30px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(123, 128, 133);\"><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mengkoordinasikan penyusunan Standar Operasional Prosedur, yang selanjutnya disebut SOP, tentang pengumpulan, pendokumentasian dan pelayanan informasi publik, serta penanganan penyelesaian sengketa informasi;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mengkoordinasikan penyusunan dan pemutakhiran Daftar Informasi Publik dan Daftar Informasi yang Dikecualikan;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mengkoordinasikan dan melakukan uji konsekuensi terhadap informasi yang dikecualikan;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Melaksanakan penyediaan, penyimpanan, pendokumentasian dan pengamanan informasi publik;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Merencanakan, mengorganisasikan, melaksanakan, mengawasi, mengevaluasi pelaksanaan kegiatan pengelolaan dan pelayanan informasi, serta penyelesaian sengketa informasi publik;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mengembangkan kapasitas kelembagaan dan pejabat fungsional dan/atau petugas pengelola informasi dalam rangka peningkatan kualitas layanan informasi publik;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Menetapkan pertimbangan tertulis atas setiap informasi publik yang ditutup untuk dapat melindungi kepentingan yang lebih besar daripada membukanya, atau sebaliknya;</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Menyebarluaskan informasi publik melalui media komunikasi dan publikasi.</li></ol><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133);\">Fungsi PPID Utama BKKBN adalah sebagai berikut:</p><ol style=\"margin-right: 0px; margin-bottom: 0.273em; margin-left: 30px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(123, 128, 133);\"><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Membentuk dan menetapkan petugas informasi di bawah wewenang dan koordinasinya</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Menugaskan petugas informasi untuk membuat, memelihara, dan/atau memutakhirkan Daftar Informasi Publik secara berskala sekurang-kurangnnya 1 (satu) kali dalam sebulan</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mengkoordinasikan setiap PPID Pelaksana dan Petugas Informasi yang mengelola Meja Informasi dalam melaksanakan pelayanan informasi publik</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Memutuskan suatu Informasi Publik dapat diakses publik atau tidak berdasarkan pengujian tentang konsekuensi dengan seksama dan penuh ketelitian sebelum menyatakan informasi publik tertentu dikecualikan untuk diakses oleh setiap orang</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Menolak permohonan informasi publik secara tertulis apabila informasi publik yang dimohonn termasuk informasi yang dikecualikan/rahasia dengan disertai alasan serta pemberitahuan</li></ol><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133); text-align: justify;\">Menyusun laporan tahunan pelaksanaan kegiatan pengelolaan dan pelayanan informasi untuk disampaikan kepada Pembina PPID dan Komisi Informasi Pusat</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133);\"><span style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Visi PPID :</span></p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133);\">Terwujudnya pelayanan informasi yanng transparan dan akuntabel untuk memenuhi hak pemohon informasi program Pembangunan Keluarga, Kependudukan dan Kelurga Berencana.</p><p style=\"margin-right: 0px; margin-bottom: 13px; margin-left: 0px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: 1.615; font-family: &quot;Open Sans&quot;; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133);\"><span style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Misi PPID:</span></p><ol style=\"margin-right: 0px; margin-bottom: 0.273em; margin-left: 30px; padding: 0.5px; border: 0px; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; list-style-position: initial; list-style-image: initial; color: rgb(123, 128, 133);\"><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Meningkatkan pengelolaan dan pelayanan informasi yang berkualitas, benar dan bertanggung jawab.</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Mewujudkan keterbukaan informasi BKKBN dengan proses yang cepat, tepat, mudah dan sederhana.</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Meningkatkan dan mengembangkan kompetensi dan kualitas SDM dalam bidang pelayanan informasi.</li><li style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\">Membangun dan mengembangkan sistem penyediaan dan layanan informasi</li></ol><p style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\"><br></p><p style=\"margin: 0px; padding: 0.5px 0.5px 0.273em; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; list-style-position: inside; list-style-type: square; list-style-image: initial !important;\"><img src=\"http:/storage/photos/1/struktur.jpg\" style=\"width: 1280px;\"><br></p>', 'active');
