INSERT INTO `pages` VALUES (15, '/pages-lokasi-dan-kontak', 'lokasi-dan-kontak', '2', 'Lokasi dan Kontak', '<p><br></p><p><iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3966.0751532040995!2d106.880824!3d-6.253829!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x7570c6f380ae0a01!2sBadan%20Kependudukan%20dan%20Keluarga%20Berencana%20Nasional!5e0!3m2!1sid!2sid!4v1604296107667!5m2!1sid!2sid\" width=\"100%\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe></p><address style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 14px; vertical-align: baseline; color: rgb(123, 128, 133);\"><span style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline;\">Alamat:</span><br>Jl. Permata No. 1, Halim Perdanakusuma<br>Jakarta Timur, 13650</address><p><br style=\"color: rgb(123, 128, 133); font-family: Arial, Helvetica, sans-serif; font-size: 14px;\"><abbr title=\"Phone Number\" style=\"margin: 0px; padding: 0.5px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(204, 204, 204); border-left-color: initial; border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 12.6px; vertical-align: baseline; color: rgb(34, 34, 34);\"><span style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 12.6px; vertical-align: baseline; text-decoration-line: none;\">Phone:</span></abbr><span style=\"color: rgb(123, 128, 133); font-family: Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;021-8098018</span><br style=\"color: rgb(123, 128, 133); font-family: Arial, Helvetica, sans-serif; font-size: 14px;\"><abbr title=\"Fax\" style=\"margin: 0px; padding: 0.5px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(204, 204, 204); border-left-color: initial; border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 12.6px; vertical-align: baseline; color: rgb(34, 34, 34);\"><span style=\"margin: 0px; padding: 0.5px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: 700; font-stretch: inherit; line-height: inherit; font-family: inherit; font-size: 12.6px; vertical-align: baseline; text-decoration-line: none;\">Fax:</span></abbr><span style=\"color: rgb(123, 128, 133); font-family: Arial, Helvetica, sans-serif; font-size: 14px;\">&nbsp;021-8008554</span><br style=\"color: rgb(123, 128, 133); font-family: Arial, Helvetica, sans-serif; font-size: 14px;\"><abbr title=\"Email Address\" style=\"margin: 0px; padding: 0.5px; border-width: 0px 0px 1px; border-top-style: initial; border-right-style: initial; border-bottom-style: solid; border-left-style: initial; border-top-color: initial; border-right-color: initial; border-bottom-color: rgb(204, 204, 204); border-left-color: initial; border-image: initial; font-variant-numeric: inherit; font-variant-east-asian: inherit; font-stretch: inherit; line-height: inherit; font-family: Arial, Helvetica, sans-serif; font-size: 12.6px; vertical-align: baseline; color: rgb(34, 34, 34);\"><span style=\"margin: 0px; pa