INSERT INTO `settings` VALUES (1, '3', '<p>The National Population and Family Planning Board (abbreviated as BKKBN) is a non-ministerial government agency that is under and responsible to the President through the Minister of Health. BKKBN has the task of carrying out government duties in the field of population control and organizing family planning.<br></p>', 'Tentang Aplikasi', 'http:/storage/photos/1/Logo/Logo-BKKBN.png', 'http:/storage/photos/1/Favicon/android-icon-96x96.png', 'http:/storage/photos/1/blog3.jpg', 'St. Permata No. 1, Halim Perdanakusuma East Jakarta, 13650.', '081546959913', 'bkkbn@gmail.com', 'Monday - Friday/ 09:00 - 17:00', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3966.0751532040995!2d106.880824!3d-6.253829!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x7570c6f380ae0a01!2sBadan%20Kependudukan%20dan%20Keluarga%20Berencana%20Nasional!5e0!3m2!1sid!2sid!4v1604296107667!5m2!1sid!2sid\" width=\"100%\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>', NULL, '2020-12-09 08:54:40');
INSERT INTO `settings` VALUES (3, '4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2020-11-25 08:05:39', '2020-11-25 08:05:39');
INSERT INTO `settings` VALUES (5, '2', '<p>Badan Kependudukan dan Keluarga Berencana Nasional (disingkat BKKBN) adalah lembaga pemerintah non kementerian yang berada di bawah dan bertanggung jawab kepada Presiden melalui Menteri Kesehatan. BKKBN mempunyai tugas melaksanakan tugas pemerintahan di bidang pengendalian kependudukan dan penyelenggaraan keluarga berencana.<br></p>', 'Tentang Aplikasi', 'http:/storage/photos/1/Logo/Logo-BKKBN.png', 'http:/storage/photos/1/Favicon/android-icon-96x96.png', 'http:/storage/photos/1/blog3.jpg', 'Jl. Permata No. 1, Halim Perdanakusuma Jakarta Timur, 13650.', '081546959913', 'portalberita@gmail.com', 'Senin- Jumat/ 09:00 - 17:00', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m14!1m8!1m3!1d3966.0751532040995!2d106.880824!3d-6.253829!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0x7570c6f380ae0a01!2sBadan%20Kependudukan%20dan%20Keluarga%20Berencana%20Nasional!5e0!3m2!1sid!2sid!4v1604296107667!5m2!1sid!2sid\" width=\"100%\" height=\"450\" frameborder=\"0\" style=\"border:0;\" allowfullscreen=\"\" aria-hidden=\"false\" tabindex=\"0\"></iframe>', NULL, NULL);

